import React, { useState } from 'react';
import { GroceryOrderButton } from './index.jsx';

const GroceryTestPage = () => {
  const [selectedDish, setSelectedDish] = useState(null);

  // Sample dishes with ingredients from your Spoonacular API
  const sampleDishes = [
    {
      id: 1,
      name: 'Paneer Butter Masala',
      ingredients: [
        { ingredient: 'spoon butter', quantity: 1.0, unit: '' },
        { ingredient: 'cheese', quantity: 1.0, unit: '' },
        { ingredient: 'tomatoes', quantity: 2.0, unit: 'pieces' },
        { ingredient: 'onions', quantity: 1.0, unit: 'piece' },
        { ingredient: 'ginger', quantity: 1.0, unit: 'inch' },
        { ingredient: 'garlic', quantity: 4.0, unit: 'cloves' },
        { ingredient: 'cream', quantity: 100.0, unit: 'ml' },
        { ingredient: 'spices', quantity: 1.0, unit: 'tablespoon' }
      ]
    },
    {
      id: 2,
      name: 'Pepperoni Pizza',
      ingredients: [
        { ingredient: 'all purpose flour', quantity: 1.0, unit: 'cup' },
        { ingredient: 'baking powder', quantity: 1.0, unit: 'tablespoon' },
        { ingredient: 'salt', quantity: 1.0, unit: 'teaspoon' },
        { ingredient: 'basil', quantity: 1.0, unit: 'teaspoon' },
        { ingredient: 'oregano', quantity: 1.0, unit: 'teaspoon' },
        { ingredient: 'garlic powder', quantity: 1.0, unit: 'teaspoon' },
        { ingredient: 'egg', quantity: 1.0, unit: '' },
        { ingredient: 'milk', quantity: 1.0, unit: 'cup' },
        { ingredient: 'cooking oil', quantity: 1.0, unit: 'cup' },
        { ingredient: 'tomatoes', quantity: 0.5, unit: 'can' },
        { ingredient: 'cheese', quantity: 1.0, unit: 'cup' },
        { ingredient: 'pepperoni', quantity: 1.0, unit: 'ounce' }
      ]
    },
    {
      id: 3,
      name: 'Chicken Tikka Masala',
      ingredients: [
        { ingredient: 'chicken', quantity: 500.0, unit: 'grams' },
        { ingredient: 'yogurt', quantity: 200.0, unit: 'ml' },
        { ingredient: 'tomatoes', quantity: 3.0, unit: 'pieces' },
        { ingredient: 'onions', quantity: 2.0, unit: 'pieces' },
        { ingredient: 'ginger', quantity: 1.0, unit: 'inch' },
        { ingredient: 'garlic', quantity: 4.0, unit: 'cloves' },
        { ingredient: 'cream', quantity: 150.0, unit: 'ml' },
        { ingredient: 'garam masala', quantity: 1.0, unit: 'teaspoon' }
      ]
    }
  ];

  return (
    <div className="grocery-test-page">
      <div className="test-header">
        <h1>🛒 Grocery Ordering Feature Test</h1>
        <p>Test the grocery ordering feature with sample dishes</p>
      </div>

      <div className="dishes-grid">
        {sampleDishes.map((dish) => (
          <div 
            key={dish.id} 
            className={`dish-card ${selectedDish?.id === dish.id ? 'selected' : ''}`}
            onClick={() => setSelectedDish(dish)}
          >
            <h3>{dish.name}</h3>
            <p>{dish.ingredients.length} ingredients</p>
            <div className="dish-ingredients-preview">
              {dish.ingredients.slice(0, 3).map((ingredient, index) => (
                <span key={index} className="ingredient-preview">
                  {ingredient.ingredient}
                </span>
              ))}
              {dish.ingredients.length > 3 && (
                <span className="ingredient-preview">+{dish.ingredients.length - 3} more</span>
              )}
            </div>
          </div>
        ))}
      </div>

      {selectedDish && (
        <div className="selected-dish-section">
          <div className="dish-info">
            <h2>Selected Dish: {selectedDish.name}</h2>
            <p>Ingredients needed for this recipe:</p>
          </div>

          <GroceryOrderButton 
            ingredients={selectedDish.ingredients}
            dishName={selectedDish.name}
          />
        </div>
      )}

      <div className="test-instructions">
        <h3>How to Test:</h3>
        <ol>
          <li>Click on any dish card above</li>
          <li>View the ingredients that will be ordered</li>
          <li>Click on any grocery app button (Blinkit, Zepto, BigBasket)</li>
          <li>A new tab will open with the search query pre-filled</li>
          <li>You can then add items to cart and checkout</li>
        </ol>
      </div>
    </div>
  );
};

export default GroceryTestPage;
